import React,{Component} from "react";
import "./App.css"

class App extends Component {
  constructor(){
    super()
    this.state = {
        num:1,
    }
  }

  add(){
    document.body.innerHTML += this.state.num ++
  }

  render(){
    return (
      <div className="App">
        {this.state.num}
        <button id="btn" onClick={this.add}> ok </button>
      </div>
    );
  }
}

export default App;
